	Marker:setImage( RegisterMaterial( 0xC05B2919DA0B9D9 ), 0 )
	Marker:SetAnchorsAndPosition( 0, 1, 0, 1, _1080p * 446, _1080p * 458, _1080p * 220, _1080p * 232 )
	self:addElement( Marker )
	self.Marker = Marker
	
	f0_local0( self, f1_local1, controller )
	if CONDITIONS.IsArabic() then
		ACTIONS.AnimateSequence( self, "AR", controller )
	end
	return self
end

